import "./Cat.scss";
import { Link } from "react-router-dom";

function Cat({ name, image, age }) {
  return (
    <div className="cat">
      <img className="cat__image" src={image} />
      <div className="cat__name">
        <h3 className="cat__label">
          <span className="cat__the-name">I am {name}</span>
        </h3>
        <h4 className="cat__age">
          <span className="cat__the-name">{age} old</span>
        </h4>
      </div>
    </div>
  );
}
export default Cat;
